import React, { useState }from 'react';
import '../../Estilos/style_menu.css';
import '../../Estilos/estilo.css';

//Segun estaba revisando, deberia igualmente ser un archivo para la conexion
//que se crea como una funcion y asi simplemente se llama a la conexion
//tambien que deberia ser otro archivo mas especifico del node para lo que 
//se va a hacer con los datos obtenidos del archivo front

//revisar largo y pattern para cada campo

function IngresoProducto() {
    const [nombre, setNombre] = useState('');
    const [codigo, setCodigo] = useState('');
    const [stock, setStock] = useState('');
    const [precio, setPrecio] = useState('');
    const [color, setColor] = useState('');
    const [tipo, setTipo] = useState('');
    const [stockmin, setStockmin] = useState('');
    const [imagen, setImagen] = useState(null);

    //Aqui ni idea como funciona
    const handleSubmit = (e) => {
        e.preventDefault();
        // Manejo de envio del formulario
        console.log({ nombre, codigo, stock, precio, color, tipo, imagen, stockmin });
    };

    return (
        <div style={{ marginLeft: '12%' }}>
            <div className="main-block">
                <form onSubmit={handleSubmit} encType="multipart/form-data">
                    <h1>Añadir Producto</h1>
                    <fieldset>
                        <legend>
                            <h3>Detalles del Producto</h3>
                        </legend>
                        <div className="account-details">
                            <div>
                                <label>Nombre*</label>
                                <input 
                                    type="text" 
                                    name="input-nombre" 
                                    maxLength="50" 
                                    required 
                                    value={nombre} 
                                    onChange={(e) => setNombre(e.target.value)} 
                                />
                            </div>
                            <div>
                                <label>Código Mueble*</label>
                                <input 
                                    type="text" 
                                    name="input-cod" 
                                    pattern="[0-9]+" 
                                    maxLength="4" 
                                    required 
                                    value={codigo} 
                                    onChange={(e) => setCodigo(e.target.value)} 
                                />
                            </div>
                            <div>
                                <label>Stock*</label>
                                <input 
                                    type="text" 
                                    name="input-stock" 
                                    pattern="[0-9]+" 
                                    maxLength="4" 
                                    required 
                                    value={stock} 
                                    onChange={(e) => setStock(e.target.value)} 
                                />
                            </div>
                            <div>
                                <label>Precio*</label>
                                <input 
                                    type="text" 
                                    name="input-precio" 
                                    pattern="[0-9]+" 
                                    maxLength="10" 
                                    required 
                                    value={precio} 
                                    onChange={(e) => setPrecio(e.target.value)} 
                                />
                            </div>
                            <div>
                                <label>Color Producto*</label>
                                <input 
                                    type="text" 
                                    name="input-color" 
                                    required 
                                    value={color} 
                                    onChange={(e) => setColor(e.target.value)} 
                                />
                            </div>
                            <div>
                                <label>Tipo Producto*</label>
                                <input 
                                    type="text" 
                                    name="input-tipo" 
                                    maxLength="9" 
                                    required 
                                    value={tipo} 
                                    onChange={(e) => setTipo(e.target.value)} 
                                />
                            </div>
                            <div>
                                <label>Stock Mínimo*</label>
                                <input 
                                    type="text" 
                                    name="input-stockmin" 
                                    maxLength="9" 
                                    required 
                                    value={stockmin} 
                                    onChange={(e) => setStockmin(e.target.value)} 
                                />
                            </div>
                            <div>
                                <label>Imagen del Producto</label>
                                <input 
                                    type="file" 
                                    name="input-imagen" 
                                    accept="image/*" 
                                    required 
                                    onChange={(e) => setImagen(e.target.files[0])} 
                                />
                            </div>
                        </div>
                    </fieldset>
                    <button type="submit">Añadir</button>
                </form>
            </div>
        </div>
    );
}

export default IngresoProducto;
